import React, { Component } from 'react';
// import logo from './logo.svg';
// import './App.css';
import FriendCard from "/Components/FriendCard/FriendCard.js"
import friends from "./friends.json";
class App extends Component {
  render() {
    return (
      friends.map((friend) => {
        return(
        <FriendCard
        key={friend.id}
        name={friend.name}
      image={friend.image}
      />
        )
        })

    );
  }
}

export default App;
